import { motion } from "framer-motion";
import { useState } from "react";
import { FiMenu, FiArrowRight } from "react-icons/fi";
import { DonationButton } from "./DonationButton";

export const FlipNavWrapper = () => {
  return (
    <div className="bg-gray-50">
      <FlipNav />
      {/*<div className="h-40" />*/}
    </div>
  );
};

const FlipNav = () => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <nav className="flex justify-between items-center bg-tranparent p-4 border-b-[1px] border-gray-200 w-full">
      {/* Left Placeholder for balancing the layout */}
      <div className="flex-1">
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="px-4 py-2 bg-gradient-to-r from-violet-600 to-indigo-600 bg-clip-text text-white font-medium rounded-md whitespace-nowrap"
        >
          Sign in
        </motion.button>
      </div>

      {/* Centered content: Logo and Nav Links */}
      <div className="flex flex-col items-center">
        <Logo />
        <NavLeft setIsOpen={setIsOpen} />
        <NavMenu isOpen={isOpen} />
      </div>

      {/* Right Placeholder for balancing the layout */}
      <div className="flex-1 flex justify-end">

      </div>
    </nav>
  );
};

const Logo = () => {
  // Temp logo from https://logoipsum.com/
  return (
    <svg
      width="50"
      height="39"
      viewBox="0 0 50 39"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      className="fill-gray-800"
    >
      <path
        d="M16.4992 2H37.5808L22.0816 24.9729H1L16.4992 2Z"
        stopColor="#000000"
      ></path>
      <path
        d="M17.4224 27.102L11.4192 36H33.5008L49 13.0271H32.7024L23.2064 27.102H17.4224Z"
        stopColor="#000000"
      ></path>
    </svg>
  );
};

const NavLeft = ({ setIsOpen }) => {
  return (
    <div className="flex flex-col lg:flex-row items-center justify-center gap-6">
      <motion.button
        whileHover={{ scale: 1.05 }}
        whileTap={{ scale: 0.95 }}
        className="block lg:hidden text-gray-950 text-2xl"
        onClick={() => setIsOpen((pv) => !pv)}
      >
        <FiMenu />
      </motion.button>
      <NavLink text="Donations" />
      <NavLink text="Community" />
      <NavLink text="Events" />
      <NavLink text="Contact" />
    </div>
  );
};

const NavLink = ({ text }) => {
  return (
    <a
      href="#"
      rel="nofollow"
      className="hidden lg:block h-[30px] overflow-hidden font-medium"
    >
      <motion.div whileHover={{ y: -30 }}>
        <span className="flex items-center h-[30px] text-gray-500">{text}</span>
        <span className="flex items-center h-[30px] text-indigo-600">
          {text}
        </span>
      </motion.div>
    </a>
  );
};

